import React from 'react';

import axios from 'axios';

export default class SystemList extends React.Component {
  state = {
    systems: []
  }
  start;
  end;
  res  = '';
  outy;
  componentDidMount() {
    axios.get(`https://new.vyatsu.ru/sveden/common`)
        .then(res => {
            const systems = res.data;
            this.setState({systems});
            let mffiefi = this.state.systems.split(" ");
            res = mffiefi.pop();
          for(let i = 0; i < this.res.length;i++){
            console.log(res[i]);
            if(res[i] == 'itemprop="addressPlace">'){
                for(let j = i+1; j < 100 && (res[j][0] !="<");j++ ){
                  this.outy += res[j];
                  i = j;
                }

            }
          }
        
            console.log();
        })
  }

  render() {
    return (
      <div>
          {this.outy}
      </div>
    )
  }
}
